Table and column names are opaque types in Flow. So if you try to use simple strings, like so: class Comment extends Model { static table = 'comments' @text('body') body
} You'll get errors, because you're passing 'comments' (a string) where TableName<Comment> is expected, and 'body' (again, a string) where ColumnName is expected. When using Watermelon with Flow, you must pre-define all your table and column names in one place, then only use those symbols (and not strings) in all other places. We recommend defining symbols like this: // File: model/schema.js
// @flow import { tableName, columnName, type TableName, appSchema, tableSchema } from '@nozbe/watermelondb'
import type Comment from './Comment.js' export const Tables = { comments: (tableName('comments'): TableName<Comment>), // ...
} export const Columns = { comments: { body: columnName('body'), // ... }
} export const appSchema = appSchema({ version: 1, tables: [ tableSchema({ name: Tables.comments, columns: [ { name: Columns.comments.body, type: 'string' }, ], }), // ... ]
}) And then using them like so: // File: model/Comment.js
// @flow import { Model } from '@nozbe/watermelondb'
import { text } from '@nozbe/watermelondb/decorators' import { Tables, Columns } from './schema.js' const Column = Columns.comments export default class Comment extends Model { static table = Tables.comments @text(Column.body) body: string
}

